int kernel_function(uint32_t arg_count, uint64_t args[]) {
  LOG_DBG("Enable dcache");
  ecall_dcache_enable();

  // Set memory pool arguments
  uintptr_t* mempool_args = NULL;
  uint64_t mempool_arg_cnt = 0;
  if (arg_count == 1) {
    // TODO(yruff): Remove this after deprecating everything before the V1Executor
    kernel_function_runtime_args_old_t* runtime_args = (kernel_function_runtime_args_old_t*) (args[0]);
    mempool_args = runtime_args->mempool_args;
    mempool_arg_cnt = runtime_args->mempool_arg_cnt;
  } else if (arg_count == 2) {
    kernel_function_runtime_args_t* runtime_args = (kernel_function_runtime_args_t*) (args[0]);
    uint64_t runtime_args_cnt = args[1];
    if (runtime_args_cnt != sizeof(kernel_function_runtime_args_t) / sizeof(uint64_t)) {
      LOG_ERR("Invalid runtime args size!");
      return -1;
    }
    mempool_args = runtime_args->mempool_args;
    mempool_arg_cnt = runtime_args->mempool_arg_cnt;
  } else {
    LOG_ERR("Invalid argument count: %d", arg_count);
    return -1;
  }

  // Validate number of memory pool arguments
  if (mempool_arg_cnt != 5) {
    LOG_ERR("Invalid number of arguments! Expected %d, got %d...", 5, mempool_arg_cnt);
    return -1;
  }

  // Patch memory pool addresses
  kernel_function_mempools[KERNEL_FUNCTION_MEMPOOL_IDX_POOL_DDR_CONST].addr = mempool_args[0];
  kernel_function_mempools[KERNEL_FUNCTION_MEMPOOL_IDX_POOL_DDR_INPUT].addr = mempool_args[1];
  kernel_function_mempools[KERNEL_FUNCTION_MEMPOOL_IDX_POOL_DDR_OUTPUT].addr = mempool_args[2];
  kernel_function_mempools[KERNEL_FUNCTION_MEMPOOL_IDX_POOL_L2].addr = mempool_args[3];
  kernel_function_mempools[KERNEL_FUNCTION_MEMPOOL_IDX_POOL_L2_CONST].addr = mempool_args[4];

  // Initialise drivers
  ctf_trace_utils_init();
  mempool_init(kernel_function_mempools, KERNEL_FUNCTION_MEMPOOL_IDX_COUNT);
  task_handler_init();
  datapath_init();
  datapath_enable_execution();


  LOG_DBG("Run kernel_function (%d tasks)...", kernel_function_task_count);
  uint64_t start_tick_e2e = read_csr(cycle);
  TRACE_MK_KERNEL_START();
  task_handler_status_t status = task_handler_stream_packed_tasks(&kernel_function_packed_tasks_stream, 0, 0);
  TRACE_MK_KERNEL_END();
  uint64_t end_tick_e2e = read_csr(cycle);
  LOG_WRN("[M] kernel_function %lu cycles", end_tick_e2e - start_tick_e2e);


  return (int)status;
}

